def intersection(interval1, interval2):
    start = max(interval1[0], interval2[0])
    end = min(interval1[1], interval2[1])
    if start > end:
        return "NO"
    length = end - start + 1
    if length == 1:
        return "NO"
    for i in range(2, int(length**0.5) + 1):
        if length % i == 0:
            return "NO"
    return "YES"

def minPath(grid, k):
    n = len(grid)
    directions = [(0, 1), (1, 0), (0, -1), (-1, 0)]
    visited = set()
    queue = [(grid[0][0], 0, [grid[0][0]])]

    while queue:
        value, depth, path = queue.pop(0)
        if depth == k:
            return path
        if (value, depth) in visited:
            continue
        visited.add((value, depth))
        for dx, dy in directions:
            x, y = value[0] + dx, value[1] + dy
            if 0 <= x < n and 0 <= y < n and (x, y) not in visited:
                queue.append(((x, y), depth + 1, path + [grid[x][y]]))

